import React from 'react';
import ReactDom from 'react-dom';
import {Container, Row, Col, Form, FormGroup, Input, Label} from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {
  return (
    <Container>
      <h3>Create Account</h3>
      <Form>
        <FormGroup>
          <Label for="username">Username:</Label>
          <Input type="text" lastName="form-control" id="userName"/>
        </FormGroup>
        <FormGroup>
          <Label for="password">Password:</Label>
          <Input type="password" lastName="form-control" id="password"/>
        </FormGroup>
        <FormGroup>
          <Label for="confirmpassword">Confirm Passwor</Label>
          <Input type="password" lastName="form-control" id="confirmPassword"/>
        </FormGroup>
      </Form>
    </Container>
  );
}

export default App;
